import React from "react";
import { Card } from "react-bootstrap";

function Showresult(props) {

  const displayResult = (props) => {

    const {notes} = props;

    if (notes.length > 0) {
      return  (
        notes.map((note, index) => {
        console.log(note);
        return (
          <Card key={index}>

            <div className="note" key={note.id}>
              <h3 className="note_tittle">{note.Nombre_de_la_empresa}</h3>
              <p className="note_direction">{note.Direccion}</p>
              <p className="note_nit">{note.NIT}</p>
              <p className="note_telefono">{note.Telefono}</p>
            </div>
          </Card>
        )
        })
      )
    } else {
      return (
        <h3>No hay empresas.</h3>
      )
    }

  }

  return (
    <> {displayResult(props)} </>
  )
}

export default Showresult;
